import React, { Component } from "react";
import Product from "./product";

export default class Catalog extends Component {
  renderTile = () => {
    return <Product />;
  };
  render() {
    let tiles = [];
    for (let i = 0; i < 8; i++) {
      tiles.push(this.renderTile());
    }
    return tiles;
  }
}
